import React, { Component } from 'react';
import ListMakanan from './../ListData/ListMakanan';

class MenuMakanan extends Component {
  render(){
    return(
      <div>
        <h3>Daftar Makanan Yang Kami Sediakan : </h3>
        <td>
          <ListMakanan list="../../img/nasipadang.jpg" />
        </td>
        <td>
          <ListMakanan list="../../public/img/sate.png" />
        </td>
        <td>
          <ListMakanan list="../../public/img/sotolamongan.png" />
        </td>
        <td>
          <ListMakanan list="../../public/img/nasi kentut.png" />
        </td>
        <td>
          <ListMakanan list="../../public/img/nasi kuning.jpg" />
        </td>
      </div>
    );
  }
}

export default MenuMakanan;
